// src/components/Navbar.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const menuItems = [
  { name: 'AAMS', path: '/aams' },
  { name: 'Features', path: '/features' },
  { name: 'Demo', path: '/demo' },
  { name: 'Download', path: '/download' },
  { name: 'Pricing', path: '/pricing' },
  { name: 'Support', path: '/support' },
  { name: 'FAQ', path: '/faq' },
];

const Navbar = () => {
  const [showDropdown, setShowDropdown] = useState(false);
  const navigate = useNavigate();

  const handleMenuClick = (path) => {
    navigate(path);
    setShowDropdown(false);
  };

  return (
    <nav className="bg-blue-600 text-white px-6 py-4 shadow relative">
      <div className="flex items-center justify-between">
        {/* LEFT: Dropdown Menu */}
        <div className="relative">
          <button
            onClick={() => setShowDropdown(!showDropdown)}
            className="hover:underline font-semibold"
          >
            AAMS â–¾
          </button>

          {showDropdown && (
            <div className="absolute top-10 left-0 bg-white text-black rounded shadow-lg w-64 z-50">
              <ul className="divide-y divide-gray-200">
                {menuItems.map((item) => (
                  <li
                    key={item.name}
                    className="p-3 hover:bg-gray-100 cursor-pointer"
                    onClick={() => handleMenuClick(item.path)}
                  >
                    <span className="text-blue-600 hover:underline">
                      {item.name}
                    </span>
                  </li>
                ))}
              </ul>
            </div>
          )}
        </div>

        {/* RIGHT: Optional - remove if not needed */}
        {/* <button
          onClick={() => alert("Global login/logout here if needed")}
          className="bg-white text-blue-600 px-4 py-2 rounded shadow hover:bg-gray-100"
        >
          Login
        </button> */}
      </div>
    </nav>
  );
};

export default Navbar;
